contract Token{

    /**@dev PUBLIC VARIABLES
        token_name
        token_symbol
        totalSupply
     */

    using SafeMath for uint256;

    string public token_name="ELESSAR";
    string public token_symbol = "ELS";

    uint256 public decimals = 18;
    uint256 public totalSupply;
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowances;


    event Transfer(
        address indexed _from,
        address indexed _to,
        uint256 _value
    );
    event Approval(
        address indexed owner,
        address indexed spender,
        uint256 value
    );


    /**
        Constructor
    */
    constructor() public{
        totalSupply = 1000000 * (10 ** decimals);
        balanceOf[msg.sender] = totalSupply;
    }

    /**
        ERC20 Transfer Functionality
        Contract Deployer's Tokens Should Be Greater Than The Value Transferred
    * @param _to  Send the tokens to
    * @param _value Value of the tokens
    */

    function transfer(address _to, uint256 _value)public returns (bool success) {
        require(balanceOf[msg.sender] >= _value, "NOT ENOUGH");
        _transfer(msg.sender,_to, _value);
        return true;
    }


        /**
        ERC20 Transfer Functionality
        Contract Deployer's Tokens Should Be Greater Than The Value Transferred
        Deducts from the _from address
        Sends 
    * @param _from  Send the tokens From
    * @param _to Send of the tokens To
    * @param _value  Value Of The Token
    */
    function _transfer(address _from, address _to, uint256 _value) internal{
        require(_to !=address(0));
        balanceOf[_from] = balanceOf[_from].sub(_value);
        balanceOf[_to]= balanceOf[_to].add(_value);
        emit Transfer(_from, _to, _value);
    }

}

